 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#ff6600;font-size:37px;\"><B>Ruang Guru</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;\">Tempat ini dinamakan ruang guru atau bisa juga disebut kantor guru, disini lah tempat bagi para guru untuk menyimpan data - data yang berurusan dengan siswa dan siswi disekolah ini, Ruang guru juga menjadi tempat bagi para guru untuk beristirahat ketika sudah menyelesaikan jam pelajaran sesuai jadwal yang mereka jalani. Di ruang ini juga bisa menjadi tempat untuk para guru dalam melakukan rapat dengan kepala sekolah.</SPAN></SPAN></DIV></div>",
