 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:left;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#0099ff;font-size:37px;\"><B>Lab Biologi</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;\">Disini adalah Laboratorium Biologi, Lab ini digunakan sebagai tempat praktek para siswa dan siswi pada mata pelajaran biologi. Pada lab ini berisi macam - macam alat untuk yang biasa digunakan untuk praktek siswa - siswi seperti replika tuang manusia, gambaran pencernaan manusia, replika dari telinga dan lain - lain.</SPAN></SPAN></DIV></div>",
